import React from 'react'
import Navbar from '../components/Common/Navbar'

const Profile = () => {
  return (
    <div className="max-w-2xl mx-auto relative">
        <Navbar/>
      <h1 className="text-3xl font-bold  underline">
      Profile
    </h1>

    </div>
  )
}

export default Profile
